import React from 'react';
import './CandidateItem.css'
import {Link,withRouter} from "react-router-dom";
const CandidatesItems = (props) => {

  return (

    <div className='posts'>
      <Link to='/post'>
        <div className='description'>
          <div>
          <img src={props.candidate_image} alt={props.name} />
          <h4 >{props.title}</h4>
           <h4 >{props.name}</h4>
          <Link to={`/users/${props.user}`}>
            <button>View Profile</button>
          </Link>
           </div>
        </div>
      </Link>
    </div>
  )
};

export default withRouter(CandidatesItems);
